    - ID: "30b0a514-dc94-432c-9655-8c01e474023f"
      Hint: ExtendedContent
      Value: "Grouping fish by type and assuming they eat the same food deprives many species of proper nutrition. Aqueon PRO foods take a different approach. Looking at what fish naturally eat is the focus of each new formula. The new Wellplex®, a proprietary blend of macro and micro algae as well as Vitamin C and Vitamin E, supports the fish's immune system more holistically. Everyone wants their fish to be happy and healthy. Aqueon PRO foods are high quality, formulated with ingredients designed by leading fish nutritionists and focused on the natural diet of the fish. Traveling is stressful on fish which can result in them not eating. The fundamental goal of the Revitanew® Formula is to holistically combat the negative effects of stress on fish. The combination of highly palatable ingredients with increased proteins and fats, work together to entice fish to continue eating. Additional Wellplex® along with other probiotic ingredients, leads to a well-supported immune system. Satisfaction Guarantee."
